import { UnderConstruction } from "../UnderConstruction"

export const ResearchPage = () => {
    return (
        <Content>
            <UnderConstruction />
            <Tabs />
        </Content>
    )
}

const Tabs = () => {
    return (
        <TabContainer>
            <div></div>
            <div></div>
            <div></div>
        </TabContainer>
    )
}

// styled components ------------------------------------------------------------------
const Content = styled.div({
    paddingTop: 50,
    display: "flex",
